@Magdalena Motylińska a to ciekawe 
https://www.plotek.pl/plotek/1,78649,20149547,vanessa-paradis-broni-deppa-nigdy-nie-podniosl-na-mnie-reki.html 
14 lat związku, wszędzie pisze, że żoną jednak była. Tu nie chodzi o gloryfikację przemocy domowej obojętnie kto kim jest ale, nie cierpię kłamstw i manipulatorek dla sławy i kasy. Tutaj ewidętnie coś nie jest

@Karolina ja też to tak odebrałam. Tym bardziej, że ona była w miejscu, gdzie opowiada o swoich traumatycznych przezyciach, które podobno doświadczyła, w miejscu, które wymaga od nas kultury rozmowy i opanowania. 
W sądzie raczej przy zeznaniach nikt nie mówi "wtedy moja mamusia była w kuchni", tylko uzyje słowa "mama" ewentualnie "matka".
Jeszcze sposób w jaki to mówi "baby sister", to jakby chciala właśnie, żeby wszyscy co to uslusza jej współczuli i pomyśleli "ojej, jaka biedna, mała siostrzyczka Amber"

@Karolina Wiesz są różne osoby z psychopatią, często takie osoby krzywdzą innych dla samej satysfakcji że kogoś zniszczyły. Często nie trzeba być psychopatą, socjopatą, czasem wystarczy mieć niską samoocenę (wręcz brak pewności siebie) albo być narcyzem.
Tego się nie dowiemy.
Ale głupia na pewno nie jest.

@Asia Palczek nie chodzi mi tylko o jego sytuację z nia, on jest taki do wszystkich. Osoby, ktore maja pasywno-agresywne zachowania, w kurwia innych a później "ale ja nic nie zrobilem/zrobiłam".
Czy ją bił? Nie wiem, tylko oni wiedzą, ale pewne jest, ze on ją wykańczał psychicznie.
Oni od samego początku nie powinni byc ze sobą
